import { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import api from "../api";

export default function PropertiesList() {
  const [inmuebles, setInmuebles] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    const fetchInmuebles = async () => {
      setError(null);
      setLoading(true);
      try {
        const res = await api.get("/inmuebles/");
        setInmuebles(res.data);
      } catch (err) {
        console.error(err);
        if (err.response?.status === 401) {
          setError("Token inválido o expirado. Por favor, inicia sesión.");
        } else {
          setError("Error al cargar inmuebles.");
        }
      } finally {
        setLoading(false);
      }
    };
    fetchInmuebles();
  }, []);

  if (loading) return <div>Cargando inmuebles...</div>;

  if (error)
    return (
      <div className="text-red-600 p-4 bg-red-100 border border-red-300 rounded">
        {error}
      </div>
    );

  return (
    <div className="bg-white p-4 shadow rounded w-full">
      <h2 className="text-xl font-bold mb-4">Lista de Inmuebles</h2>
      <table className="w-full table-auto border-collapse text-sm">
        <thead>
          <tr className="bg-gray-200 text-left">
            <th className="px-4 py-2">Dirección</th>
            <th className="px-4 py-2">Propietario</th>
            <th className="px-4 py-2">Estado CRM</th>
            <th className="px-4 py-2">Motivación</th>
            <th className="px-4 py-2">Precio pedido (€)</th>
            <th className="px-4 py-2">Valoración (€)</th>
            <th className="px-4 py-2">Prioridad</th>
            <th className="px-4 py-2">Última venta/alquiler</th>
          </tr>
        </thead>
        <tbody>
          {inmuebles.map((inmueble) => (
            <tr
              key={inmueble.id}
              className="hover:bg-gray-100 cursor-pointer"
              onClick={() => navigate(`/inmuebles/${inmueble.id}`)}
            >
              <td className="px-4 py-2">
                {inmueble.edificio
                  ? `${inmueble.edificio.calle} ${inmueble.edificio.numero_calle}, Planta ${inmueble.planta} Puerta ${inmueble.puerta}`
                  : "Sin dirección"}
              </td>
              <td className="px-4 py-2">
                {inmueble.propietario
                  ? `${inmueble.propietario.nombre} ${inmueble.propietario.apellido1}`
                  : "Sin propietario"}
              </td>
              <td className="px-4 py-2">{inmueble.estado_CRM || "—"}</td>
              <td className="px-4 py-2">{inmueble.motivacion || "—"}</td>
              <td className="px-4 py-2">
                {inmueble.precio_pedido_cliente
                  ? `${inmueble.precio_pedido_cliente.toLocaleString()}`
                  : "—"}
              </td>
              <td className="px-4 py-2">
                {inmueble.valoracion
                  ? `${inmueble.valoracion.toLocaleString()}`
                  : "—"}
              </td>
              <td className="px-4 py-2">{inmueble.prioridad_noticia || "—"}</td>
              <td className="px-4 py-2">
                {inmueble.fecha_ultima_venta_alquiler || "—"}
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
